        const res = await getUserInfo({'id':'1'});
        console.log("callUserInfoAPI_res:",res)
    }

    render() {
        return <div className="home">
            Home
            <Link to={'/bottom/mockJS'}>MockJS</Link>
            <div className="buttonWrapper">
                <Button onClick={this.callUserInfoAPI}>
                    userInfoAPI
                </Button>

            </div>
        </div>
    }
}
